package com.example.aitongji.Utils.cache;

/**
 * Created by Novemser on 2016/11/30.
 */
public abstract class Info implements Cloneable {
    protected String id;
    protected String content;

    public String getId() {
        return id;
    }

    public void setId(String id) {
        this.id = id;
    }

    public String getContent() {
        return content;
    }

    public void setContent(String content) {
        this.content = content;
    }

    @Override
    public Object clone() {
        Object clone = null;
        try {
            clone = super.clone();
        } catch (CloneNotSupportedException e) {
            e.printStackTrace();
        }
        return clone;
    }
}
